import React, { useContext } from 'react';
import BeerContext from '../context/beers';

const BeerList = () => {
  const beers = useContext(BeerContext);

  return (
    <div>
      {beers.map((beer) => (
        <div key={beer.id}>{beer.name}</div>
      ))}
    </div>
  );
};

export default BeerList;
